import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on "Your Profile" link using XPath
    const profileLink = await page.waitForSelector('xpath=//a[contains(text(), "Your Profile")]', { timeout: 5000 });
    await profileLink.click();

    // Wait for profile page to load
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot after navigating to profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const profileData = await page.evaluate(() => {
      const fullName = document.querySelector('.profile-info h2')?.textContent || 'Not found';
      const username = document.querySelector('.username')?.textContent || 'Not found';
      const bio = document.querySelector('.bio')?.textContent || 'Not found';

      const stats = {};
      document.querySelectorAll('.stat').forEach(stat => {
        const label = stat.querySelector('.stat-label')?.textContent?.trim();
        const value = stat.querySelector('.stat-number')?.textContent;
        if (label && value) {
          stats[label] = value;
        }
      });

      return {
        fullName,
        username,
        bio,
        stats
      };
    });

    // Take final screenshot with profile data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Harvested user profile information successfully",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
